--drop table hurtos;

create table hurtos
(
fecha date,
departamento character varying,
municipio character varying,
día character varying,
barrio character varying,
zona character varying,
clase_de_sitio character varying,
arma_empleada character varying,
móvil_agresor character varying,
móvil_victima character varying,
edad numeric,
sexo character varying,
estado_civil character varying,
país_de_nacimiento character varying,
clase_de_empleado character varying,
profesion character varying,
escolaridad character varying,
codigo_dane numeric,
cantidad numeric
);

